INSERT INTO `fhirresourceslist` VALUES ('Foundation','Conformance','CapabilityStatement','A Capability Statement documents a set of capabilities (behaviors) of a FHIR Server for a particular version of FHIR that may be used as a statement of actual server functionality or a statement of required or desired server implementation.','https://www.hl7.org/fhir/capabilitystatement.html'),('Foundation','Conformance','StructureDefinition','A definition of a FHIR structure. This resource is used to describe the underlying resources, data types defined in FHIR, and also for describing extensions and constraints on resources and data types.','https://www.hl7.org/fhir/structuredefinition.html'),('Foundation','Conformance','ImplementationGuide','A set of rules of how a particular interoperability or standards problem is solved - typically through the use of FHIR resources. This resource is used to gather all the parts of an implementation guide into a logical whole and to publish a computable definition of all the parts.','https://www.hl7.org/fhir/implementationguide.html'),('Foundation','Conformance','SearchParameter','A search parameter that defines a named search item that can be used to search/filter on a resource.','https://www.hl7.org/fhir/searchparameter.html'),('Foundation','Conformance','MessageDefinition','Defines the characteristics of a message that can be shared between systems, including the type of event that initiates the message, the content to be transmitted and what response(s), if any, are permitted.','https://www.hl7.org/fhir/messagedefinition.html'),('Foundation','Conformance','OperationDefinition','A formal computable definition of an operation (on the RESTful interface) or a named query (using the search interaction).','https://www.hl7.org/fhir/operationdefinition.html'),('Foundation','Conformance','CompartmentDefinition','A compartment definition that defines how resources are accessed on a server.','https://www.hl7.org/fhir/compartmentdefinition.html'),('Foundation','Conformance','StructureMap','A Map of relationships between 2 structures that can be used to transform data.','https://www.hl7.org/fhir/structuremap.html'),('Foundation','Conformance','GraphDefinition','A formal computable definition of a graph of resources - that is, a coherent set of resources that form a graph by following references. The Graph Definition resource defines a set and makes rules about the set.','https://www.hl7.org/fhir/graphdefinition.html'),('Foundation','Conformance','ExampleScenario','Example of workflow instance.','https://www.hl7.org/fhir/examplescenario.html'),('Foundation','Terminology','CodeSystem','The CodeSystem resource is used to declare the existence of and describe a code system or code system supplement and its key properties, and optionally define a part or all of its content.','https://www.hl7.org/fhir/codesystem.html'),('Foundation','Terminology','ValueSet','A ValueSet resource instance specifies a set of codes drawn from one or more code systems, intended for use in a particular context. Value sets link between [[[CodeSystem]]] definitions and their use in [coded elements](terminologies.html).','https://www.hl7.org/fhir/valueset.html'),('Foundation','Terminology','ConceptMap','A statement of relationships from one set of concepts to one or more other concepts - either concepts in code systems, or data element/data element concepts, or classes in class models.','https://www.hl7.org/fhir/conceptmap.html'),('Foundation','Terminology','NamingSystem','A curated namespace that issues unique symbols within that namespace for the identification of concepts, people, devices, etc.  Represents a \"System\" used within the Identifier and Coding data types.','https://www.hl7.org/fhir/namingsystem.html'),('Foundation','Terminology','TerminologyCapabilities','A TerminologyCapabilities resource documents a set of capabilities (behaviors) of a FHIR Terminology Server that may be used as a statement of actual server functionality or a statement of required or desired server implementation.','https://www.hl7.org/fhir/terminologycapabilities.html'),('Foundation','Security','Provenance','Provenance of a resource is a record that describes entities and processes involved in producing and delivering or otherwise influencing that resource. Provenance provides a critical foundation for assessing authenticity, enabling trust, and allowing reproducibility. Provenance assertions are a form of contextual metadata and can themselves become important records with their own provenance. Provenance statement indicates clinical significance in terms of confidence in authenticity, reliability, and trustworthiness, integrity, and stage in lifecycle (e.g. Document Completion - has the artifact been legally authenticated), all of which may impact security, privacy, and trust policies.','https://www.hl7.org/fhir/provenance.html'),('Foundation','Security','AuditEvent','A record of an event made for purposes of maintaining a security log. Typical uses include detection of intrusion attempts and monitoring for inappropriate usage.','https://www.hl7.org/fhir/auditevent.html'),('Foundation','Security','Consent','A record of a healthcare consumers  choices, which permits or denies identified recipient(s) or recipient role(s) to perform one or more actions within a given policy context, for specific purposes and periods of time.','https://www.hl7.org/fhir/consent.html'),('Foundation','Documents','Composition','A set of healthcare-related information that is assembled together into a single logical package that provides a single coherent statement of meaning, establishes its own context and that has clinical attestation with regard to who is making the statement. A Composition defines the structure and narrative content necessary for a document. However, a Composition alone does not constitute a document. Rather, the Composition must be the first entry in a Bundle where Bundle.type=document, and any other resources referenced from Composition must be included as subsequent entries in the Bundle (for example Patient, Practitioner, Encounter, etc.).','https://www.hl7.org/fhir/composition.html'),('Foundation','Documents','DocumentManifest','A collection of documents compiled for a purpose together with metadata that applies to the collection.','https://www.hl7.org/fhir/documentmanifest.html'),('Foundation','Documents','DocumentReference','A reference to a document of any kind for any purpose. Provides metadata about the document so that the document can be discovered and managed. The scope of a document is any seralized object with a mime-type, so includes formal patient centric documents (CDA), cliical notes, scanned paper, and non-patient specific documents like policy text.','https://www.hl7.org/fhir/documentreference.html'),('Foundation','Documents','CatalogEntry','Catalog entries are wrappers that contextualize items included in a catalog.','https://www.hl7.org/fhir/catalogentry.html'),('Foundation','Other','Basic','Basic is used for handling concepts not yet defined in FHIR, narrative-only resources that dont map to an existing resource, and custom resources not appropriate for inclusion in the FHIR specification.','https://www.hl7.org/fhir/basic.html'),('Foundation','Other','Binary','A resource that represents the data of a single raw artifact as digital content accessible in its native format.  A Binary resource can contain any content, whether text, image, pdf, zip archive, etc.','https://www.hl7.org/fhir/binary.html'),('Foundation','Other','Bundle','A container for a collection of resources.','https://www.hl7.org/fhir/bundle.html'),('Foundation','Other','Linkage','Identifies two or more records (resource instances) that refer to the same real-world \"occurrence\".','https://www.hl7.org/fhir/linkage.html'),('Foundation','Other','MessageHeader','The header for a message exchange that is either requesting or responding to an action.  The reference(s) that are the subject of the action as well as other information related to the action are typically transmitted in a bundle in which the MessageHeader resource instance is the first resource in the bundle.','https://www.hl7.org/fhir/messageheader.html'),('Foundation','Other','OperationOutcome','A collection of error, warning, or information messages that result from a system action.','https://www.hl7.org/fhir/operationoutcome.html'),('Foundation','Other','Parameters','This resource is a non-persisted resource used to pass information into and back from an [operation](operations.html). It has no other use, and there is no RESTful endpoint associated with it.','https://www.hl7.org/fhir/parameters.html'),('Foundation','Other','Subscription','The subscription resource is used to define a push-based subscription from a server to another system. Once a subscription is registered with the server, the server checks every resource that is created or updated, and if the resource matches the given criteria, it sends a message on the defined \"channel\" so that another system can take an appropriate action.','https://www.hl7.org/fhir/subscription.html'),('Base','Individuals','Patient','Demographics and other administrative information about an individual or animal receiving care or other health-related services.','https://www.hl7.org/fhir/patient.html'),('Base','Individuals','Practitioner','A person who is directly or indirectly involved in the provisioning of healthcare.','https://www.hl7.org/fhir/practitioner.html'),('Base','Individuals','PractitionerRole','A specific set of Roles/Locations/specialties/services that a practitioner may perform at an organization for a period of time.','https://www.hl7.org/fhir/practitionerrole.html'),('Base','Individuals','RelatedPerson','Information about a person that is involved in the care for a patient, but who is not the target of healthcare, nor has a formal responsibility in the care process.','https://www.hl7.org/fhir/relatedperson.html'),('Base','Individuals','Person','Demographics and administrative information about a person independent of a specific health-related context.','https://www.hl7.org/fhir/person.html'),('Base','Individuals','Group','Represents a defined collection of entities that may be discussed or acted upon collectively but which are not expected to act collectively, and are not formally or legally recognized; i.e. a collection of entities that isnt an Organization.','https://www.hl7.org/fhir/group.html'),('Base','Entities #1','Organization','A formally or informally recognized grouping of people or organizations formed for the purpose of achieving some form of collective action.  Includes companies, institutions, corporations, departments, community groups, healthcare practice groups, payer/insurer, etc.','https://www.hl7.org/fhir/organization.html'),('Base','Entities #1','OrganizationAffiliation','Defines an affiliation/assotiation/relationship between 2 distinct oganizations, that is not a part-of relationship/sub-division relationship.','https://www.hl7.org/fhir/organizationaffiliation.html'),('Base','Entities #1','HealthcareService','The details of a healthcare service available at a location.','https://www.hl7.org/fhir/healthcareservice.html'),('Base','Entities #1','Endpoint','The technical details of an endpoint that can be used for electronic services, such as for web services providing XDS.b or a REST endpoint for another FHIR server. This may include any security context information.','https://www.hl7.org/fhir/endpoint.html'),('Base','Entities #1','Location','Details and position information for a physical place where services are provided and resources and participants may be stored, found, contained, or accommodated.','https://www.hl7.org/fhir/location.html'),('Base','Entities #2','Substance','A homogeneous material with a definite composition.','https://www.hl7.org/fhir/substance.html'),('Base','Entities #2','BiologicallyDerivedProduct','A material substance originating from a biological entity intended to be transplanted or infused\ninto another (possibly the same) biological entity.','https://www.hl7.org/fhir/biologicallyderivedproduct.html'),('Base','Entities #2','Device','A type of a manufactured item that is used in the provision of healthcare without being substantially changed through that activity. The device may be a medical or non-medical device.','https://www.hl7.org/fhir/device.html'),('Base','Entities #2','DeviceMetric','Describes a measurement, calculation or setting capability of a medical device.','https://www.hl7.org/fhir/devicemetric.html'),('Base','Workflow','Task','A task to be performed.','https://www.hl7.org/fhir/task.html'),('Base','Workflow','Appointment','A booking of a healthcare event among patient(s), practitioner(s), related person(s) and/or device(s) for a specific date/time. This may result in one or more Encounter(s).','https://www.hl7.org/fhir/appointment.html'),('Base','Workflow','AppointmentResponse','A reply to an appointment request for a patient and/or practitioner(s), such as a confirmation or rejection.','https://www.hl7.org/fhir/appointmentresponse.html'),('Base','Workflow','Schedule','A container for slots of time that may be available for booking appointments.','https://www.hl7.org/fhir/schedule.html'),('Base','Workflow','Slot','A slot of time on a schedule that may be available for booking appointments.','https://www.hl7.org/fhir/slot.html'),('Base','Workflow','VerificationResult','Describes validation requirements, source(s), status and dates for one or more elements.','https://www.hl7.org/fhir/verificationresult.html'),('Base','Management','Encounter','An interaction between a patient and healthcare provider(s) for the purpose of providing healthcare service(s) or assessing the health status of a patient.','https://www.hl7.org/fhir/encounter.html'),('Base','Management','EpisodeOfCare','An association between a patient and an organization / healthcare provider(s) during which time encounters may occur. The managing organization assumes a level of responsibility for the patient during this time.','https://www.hl7.org/fhir/episodeofcare.html'),('Base','Management','Flag','Prospective warnings of potential issues when providing care to the patient.','https://www.hl7.org/fhir/flag.html'),('Base','Management','List','A list is a curated collection of resources.','https://www.hl7.org/fhir/list.html'),('Base','Management','Library','The Library resource is a general-purpose container for knowledge asset definitions. It can be used to describe and expose existing knowledge assets such as logic libraries and information model descriptions, as well as to describe a collection of knowledge assets.','https://www.hl7.org/fhir/library.html'),('Clinical','Summary','AllergyIntolerance','Risk of harmful or undesirable, physiological response which is unique to an individual and associated with exposure to a substance.','https://www.hl7.org/fhir/allergyintolerance.html'),('Clinical','Summary','AdverseEvent','Actual or  potential/avoided event causing unintended physical injury resulting from or contributed to by medical care, a research study or other healthcare setting factors that requires additional monitoring, treatment, or hospitalization, or that results in death.','https://www.hl7.org/fhir/adverseevent.html'),('Clinical','Summary','Condition','A clinical condition, problem, diagnosis, or other event, situation, issue, or clinical concept that has risen to a level of concern.','https://www.hl7.org/fhir/condition.html'),('Clinical','Summary','Procedure','An action that is or was performed on or for a patient. This can be a physical intervention like an operation, or less invasive like long term services, counseling, or hypnotherapy.','https://www.hl7.org/fhir/procedure.html'),('Clinical','Summary','FamilyMemberHistory','Significant health conditions for a person related to the patient relevant in the context of care for the patient.','https://www.hl7.org/fhir/familymemberhistory.html'),('Clinical','Summary','ClinicalImpression','A record of a clinical assessment performed to determine what problem(s) may affect the patient and before planning the treatments or management strategies that are best to manage a patients condition. Assessments are often 1:1 with a clinical consultation / encounter,  but this varies greatly depending on the clinical workflow. This resource is called \"ClinicalImpression\" rather than \"ClinicalAssessment\" to avoid confusion with the recording of assessment tools such as Apgar score.','https://www.hl7.org/fhir/clinicalimpression.html'),('Clinical','Summary','DetectedIssue','Indicates an actual or potential clinical issue with or between one or more active or proposed clinical actions for a patient; e.g. Drug-drug interaction, Ineffective treatment frequency, Procedure-condition conflict, etc.','https://www.hl7.org/fhir/detectedissue.html'),('Clinical','Diagnostics','Observation','Measurements and simple assertions made about a patient, device or other subject.','https://www.hl7.org/fhir/observation.html'),('Clinical','Diagnostics','Media','A photo, video, or audio recording acquired or used in healthcare. The actual content may be inline or provided by direct reference.','https://www.hl7.org/fhir/media.html'),('Clinical','Diagnostics','DiagnosticReport','The findings and interpretation of diagnostic  tests performed on patients, groups of patients, devices, and locations, and/or specimens derived from these. The report includes clinical context such as requesting and provider information, and some mix of atomic results, images, textual and coded interpretations, and formatted representation of diagnostic reports.','https://www.hl7.org/fhir/diagnosticreport.html'),('Clinical','Diagnostics','Specimen','A sample to be used for analysis.','https://www.hl7.org/fhir/specimen.html'),('Clinical','Diagnostics','BodyStructure','Record details about an anatomical structure.  This resource may be used when a coded concept does not provide the necessary detail needed for the use case.','https://www.hl7.org/fhir/bodystructure.html'),('Clinical','Diagnostics','ImagingStudy','Representation of the content produced in a DICOM imaging study. A study comprises a set of series, each of which includes a set of Service-Object Pair Instances (SOP Instances - images or other data) acquired or produced in a common context.  A series is of only one modality (e.g. X-ray, CT, MR, ultrasound), but a study may have multiple series of different modalities.','https://www.hl7.org/fhir/imagingstudy.html'),('Clinical','Diagnostics','QuestionnaireResponse','A structured set of questions and their answers. The questions are ordered and grouped into coherent subsets, corresponding to the structure of the grouping of the questionnaire being responded to.','https://www.hl7.org/fhir/questionnaireresponse.html'),('Clinical','Diagnostics','MolecularSequence','Raw data describing a biological sequence.','https://www.hl7.org/fhir/molecularsequence.html'),('Clinical','Medications','MedicationRequest','An order or request for both supply of the medication and the instructions for administration of the medication to a patient. The resource is called \"MedicationRequest\" rather than \"MedicationPrescription\" or \"MedicationOrder\" to generalize the use across inpatient and outpatient settings, including care plans, etc., and to harmonize with workflow patterns.','https://www.hl7.org/fhir/medicationrequest.html'),('Clinical','Medications','MedicationAdministration','Describes the event of a patient consuming or otherwise being administered a medication.  This may be as simple as swallowing a tablet or it may be a long running infusion.  Related resources tie this event to the authorizing prescription, and the specific encounter between patient and health care practitioner.','https://www.hl7.org/fhir/medicationadministration.html'),('Clinical','Medications','MedicationDispense','Indicates that a medication product is to be or has been dispensed for a named person/patient.  This includes a description of the medication product (supply) provided and the instructions for administering the medication.  The medication dispense is the result of a pharmacy system responding to a medication order.','https://www.hl7.org/fhir/medicationdispense.html'),('Clinical','Medications','MedicationStatement','A record of a medication that is being consumed by a patient.   A MedicationStatement may indicate that the patient may be taking the medication now or has taken the medication in the past or will be taking the medication in the future.  The source of this information can be the patient, significant other (such as a family member or spouse), or a clinician.  A common scenario where this information is captured is during the history taking process during a patient visit or stay.   The medication information may come from sources such as the patients memory, from a prescription bottle,  or from a list of medications the patient, clinician or other party maintains. \n\nThe primary difference between a medication statement and a medication administration is that the medication administration has complete administration information and is based on actual administration information from the person who administered the medication.  A medication statement is often, if not always, less specific.  There is no required date/time when the medication was administered, in fact we only know that a source has reported the patient is taking this medication, where details such as time, quantity, or rate or even medication product may be incomplete or missing or less precise.  As stated earlier, the medication statement information may come from the patients memory, from a prescription bottle or from a list of medications the patient, clinician or other party maintains.  Medication administration is more formal and is not missing detailed information.','https://www.hl7.org/fhir/medicationstatement.html'),('Clinical','Medications','Medication','This resource is primarily used for the identification and definition of a medication for the purposes of prescribing, dispensing, and administering a medication as well as for making statements about medication use.','https://www.hl7.org/fhir/medication.html'),('Clinical','Medications','MedicationKnowledge','Information about a medication that is used to support knowledge.','https://www.hl7.org/fhir/medicationknowledge.html'),('Clinical','Medications','Immunization','Describes the event of a patient being administered a vaccine or a record of an immunization as reported by a patient, a clinician or another party.','https://www.hl7.org/fhir/immunization.html'),('Clinical','Medications','ImmunizationEvaluation','Describes a comparison of an immunization event against published recommendations to determine if the administration is \"valid\" in relation to those  recommendations.','https://www.hl7.org/fhir/immunizationevaluation.html'),('Clinical','Medications','ImmunizationRecommendation','A patients point-in-time set of recommendations (i.e. forecasting) according to a published schedule with optional supporting justification.','https://www.hl7.org/fhir/immunizationrecommendation.html'),('Clinical','Care Provision','CarePlan','Describes the intention of how one or more practitioners intend to deliver care for a particular patient, group or community for a period of time, possibly limited to care for a specific condition or set of conditions.','https://www.hl7.org/fhir/careplan.html'),('Clinical','Care Provision','CareTeam','The Care Team includes all the people and organizations who plan to participate in the coordination and delivery of care for a patient.','https://www.hl7.org/fhir/careteam.html'),('Clinical','Care Provision','Goal','Describes the intended objective(s) for a patient, group or organization care, for example, weight loss, restoring an activity of daily living, obtaining herd immunity via immunization, meeting a process improvement objective, etc.','https://www.hl7.org/fhir/goal.html'),('Clinical','Care Provision','ServiceRequest','A record of a request for service such as diagnostic investigations, treatments, or operations to be performed.','https://www.hl7.org/fhir/servicerequest.html'),('Clinical','Care Provision','NutritionOrder','A request to supply a diet, formula feeding (enteral) or oral nutritional supplement to a patient/resident.','https://www.hl7.org/fhir/nutritionorder.html'),('Clinical','Care Provision','VisionPrescription','An authorization for the provision of glasses and/or contact lenses to a patient.','https://www.hl7.org/fhir/visionprescription.html'),('Clinical','Care Provision','RiskAssessment','An assessment of the likely outcome(s) for a patient or other subject as well as the likelihood of each outcome.','https://www.hl7.org/fhir/riskassessment.html'),('Clinical','Care Provision','RequestGroup','A group of related requests that can be used to capture intended activities that have inter-dependencies such as \"give this medication after that one\".','https://www.hl7.org/fhir/requestgroup.html'),('Clinical','Request & Response','Communication','An occurrence of information being transmitted; e.g. an alert that was sent to a responsible provider, a public health agency that was notified about a reportable condition.','https://www.hl7.org/fhir/communication.html'),('Clinical','Request & Response','CommunicationRequest','A request to convey information; e.g. the CDS system proposes that an alert be sent to a responsible provider, the CDS system proposes that the public health agency be notified about a reportable condition.','https://www.hl7.org/fhir/communicationrequest.html'),('Clinical','Request & Response','DeviceRequest','Represents a request for a patient to employ a medical device. The device may be an implantable device, or an external assistive device, such as a walker.','https://www.hl7.org/fhir/devicerequest.html'),('Clinical','Request & Response','DeviceUseStatement','A record of a device being used by a patient where the record is the result of a report from the patient or another clinician.','https://www.hl7.org/fhir/deviceusestatement.html'),('Clinical','Request & Response','GuidanceResponse','A guidance response is the formal response to a guidance request, including any output parameters returned by the evaluation, as well as the description of any proposed actions to be taken.','https://www.hl7.org/fhir/guidanceresponse.html'),('Clinical','Request & Response','SupplyRequest','A record of a request for a medication, substance or device used in the healthcare setting.','https://www.hl7.org/fhir/supplyrequest.html'),('Clinical','Request & Response','SupplyDelivery','Record of delivery of what is supplied.','https://www.hl7.org/fhir/supplydelivery.html'),('Financial','Support','Coverage','Financial instrument which may be used to reimburse or pay for health care products and services. Includes both insurance and self-payment.','https://www.hl7.org/fhir/coverage.html'),('Financial','Support','CoverageEligibilityRequest','The CoverageEligibilityRequest provides patient and insurance coverage information to an insurer for them to respond, in the form of an CoverageEligibilityResponse, with information regarding whether the stated coverage is valid and in-force and optionally to provide the insurance details of the policy.','https://www.hl7.org/fhir/coverageeligibilityrequest.html'),('Financial','Support','CoverageEligibilityResponse','This resource provides eligibility and plan details from the processing of an CoverageEligibilityRequest resource.','https://www.hl7.org/fhir/coverageeligibilityresponse.html'),('Financial','Support','EnrollmentRequest','This resource provides the insurance enrollment details to the insurer regarding a specified coverage.','https://www.hl7.org/fhir/enrollmentrequest.html'),('Financial','Support','EnrollmentResponse','This resource provides enrollment and plan details from the processing of an EnrollmentRequest resource.','https://www.hl7.org/fhir/enrollmentresponse.html'),('Financial','Billing','Claim','A provider issued list of professional services and products which have been provided, or are to be provided, to a patient which is sent to an insurer for reimbursement.','https://www.hl7.org/fhir/claim.html'),('Financial','Billing','ClaimResponse','This resource provides the adjudication details from the processing of a Claim resource.','https://www.hl7.org/fhir/claimresponse.html'),('Financial','Billing','Invoice','Invoice containing collected ChargeItems from an Account with calculated individual and total price for Billing purpose.','https://www.hl7.org/fhir/invoice.html'),('Financial','Payment','PaymentNotice','This resource provides the status of the payment for goods and services rendered, and the request and response resource references.','https://www.hl7.org/fhir/paymentnotice.html'),('Financial','Payment','PaymentReconciliation','This resource provides the details including amount of a payment and allocates the payment items being paid.','https://www.hl7.org/fhir/paymentreconciliation.html'),('Financial','General','Account','A financial tool for tracking value accrued for a particular purpose.  In the healthcare field, used to track charges for a patient, cost centers, etc.','https://www.hl7.org/fhir/account.html'),('Financial','General','ChargeItem','The resource ChargeItem describes the provision of healthcare provider products for a certain patient, therefore referring not only to the product, but containing in addition details of the provision, like date, time, amounts and participating organizations and persons. Main Usage of the ChargeItem is to enable the billing process and internal cost allocation.','https://www.hl7.org/fhir/chargeitem.html'),('Financial','General','ChargeItemDefinition','The ChargeItemDefinition resource provides the properties that apply to the (billing) codes necessary to calculate costs and prices. The properties may differ largely depending on type and realm, therefore this resource gives only a rough structure and requires profiling for each type of billing code system.','https://www.hl7.org/fhir/chargeitemdefinition.html'),('Financial','General','Contract','Legally enforceable, formally recorded unilateral or bilateral directive i.e., a policy or agreement.','https://www.hl7.org/fhir/contract.html'),('Financial','General','ExplanationOfBenefit','This resource provides: the claim details; adjudication details from the processing of a Claim; and optionally account balance information, for informing the subscriber of the benefits provided.','https://www.hl7.org/fhir/explanationofbenefit.html'),('Financial','General','InsurancePlan','Details of a Health Insurance product/plan provided by an organization.','https://www.hl7.org/fhir/insuranceplan.html'),('Specialized','Public Health & Research','ResearchStudy','A process where a researcher or organization plans and then executes a series of steps intended to increase the field of healthcare-related knowledge.  This includes studies of safety, efficacy, comparative effectiveness and other information about medications, devices, therapies and other interventional and investigative techniques.  A ResearchStudy involves the gathering of information about human or animal subjects.','https://www.hl7.org/fhir/researchstudy.html'),('Specialized','Public Health & Research','ResearchSubject','A physical entity which is the primary unit of operational and/or administrative interest in a study.','https://www.hl7.org/fhir/researchsubject.html'),('Specialized','Definitional Artifacts','ActivityDefinition','This resource allows for the definition of some activity to be performed, independent of a particular patient, practitioner, or other performance context.','https://www.hl7.org/fhir/activitydefinition.html'),('Specialized','Definitional Artifacts','DeviceDefinition','The characteristics, operational status and capabilities of a medical-related component of a medical device.','https://www.hl7.org/fhir/devicedefinition.html'),('Specialized','Definitional Artifacts','EventDefinition','The EventDefinition resource provides a reusable description of when a particular event can occur.','https://www.hl7.org/fhir/eventdefinition.html'),('Specialized','Definitional Artifacts','ObservationDefinition','Set of definitional characteristics for a kind of observation or measurement produced or consumed by an orderable health care service.','https://www.hl7.org/fhir/observationdefinition.html'),('Specialized','Definitional Artifacts','PlanDefinition','This resource allows for the definition of various types of plans as a sharable, consumable, and executable artifact. The resource is general enough to support the description of a broad range of clinical artifacts such as clinical decision support rules, order sets and protocols.','https://www.hl7.org/fhir/plandefinition.html'),('Specialized','Definitional Artifacts','Questionnaire','A structured set of questions intended to guide the collection of answers from end-users. Questionnaires provide detailed control over order, presentation, phraseology and grouping to allow coherent, consistent data collection.','https://www.hl7.org/fhir/questionnaire.html'),('Specialized','Definitional Artifacts','SpecimenDefinition','A kind of specimen with associated set of requirements.','https://www.hl7.org/fhir/specimendefinition.html'),('Specialized','Evidence-Based Medicine','ResearchDefinition','The ResearchDefinition resource describes the conditional state (population and any exposures being compared within the population) and outcome (if specified) that the knowledge (evidence, assertion, recommendation) is about.','https://www.hl7.org/fhir/researchdefinition.html'),('Specialized','Evidence-Based Medicine','ResearchElementDefinition','The ResearchElementDefinition resource describes a \"PICO\" element that knowledge (evidence, assertion, recommendation) is about.','https://www.hl7.org/fhir/researchelementdefinition.html'),('Specialized','Evidence-Based Medicine','Evidence','The Evidence resource describes the conditional state (population and any exposures being compared within the population) and outcome (if specified) that the knowledge (evidence, assertion, recommendation) is about.','https://www.hl7.org/fhir/evidence.html'),('Specialized','Evidence-Based Medicine','EvidenceVariable','The EvidenceVariable resource describes a \"PICO\" element that knowledge (evidence, assertion, recommendation) is about.','https://www.hl7.org/fhir/evidencevariable.html'),('Specialized','Evidence-Based Medicine','EffectEvidenceSynthesis','The EffectEvidenceSynthesis resource describes the difference in an outcome between exposures states in a population where the effect estimate is derived from a combination of research studies.','https://www.hl7.org/fhir/effectevidencesynthesis.html'),('Specialized','Evidence-Based Medicine','RiskEvidenceSynthesis','The RiskEvidenceSynthesis resource describes the likelihood of an outcome in a population plus exposure state where the risk estimate is derived from a combination of research studies.','https://www.hl7.org/fhir/riskevidencesynthesis.html'),('Specialized','Quality Reporting & Testing','Measure','The Measure resource provides the definition of a quality measure.','https://www.hl7.org/fhir/measure.html'),('Specialized','Quality Reporting & Testing','MeasureReport','The MeasureReport resource contains the results of the calculation of a measure; and optionally a reference to the resources involved in that calculation.','https://www.hl7.org/fhir/measurereport.html'),('Specialized','Quality Reporting & Testing','TestScript','A structured set of tests against a FHIR server or client implementation to determine compliance against the FHIR specification.','https://www.hl7.org/fhir/testscript.html'),('Specialized','Quality Reporting & Testing','TestReport','A summary of information based on the results of executing a TestScript.','https://www.hl7.org/fhir/testreport.html'),('Specialized','Medication Definition','MedicinalProduct','Detailed definition of a medicinal product, typically for uses other than direct patient care (e.g. regulatory use).','https://www.hl7.org/fhir/medicinalproduct.html'),('Specialized','Medication Definition','MedicinalProductAuthorization','The regulatory authorization of a medicinal product.','https://www.hl7.org/fhir/medicinalproductauthorization.html'),('Specialized','Medication Definition','MedicinalProductContraindication','The clinical particulars - indications, contraindications etc. of a medicinal product, including for regulatory purposes.','https://www.hl7.org/fhir/medicinalproductcontraindication.html'),('Specialized','Medication Definition','MedicinalProductIndication','Indication for the Medicinal Product.','https://www.hl7.org/fhir/medicinalproductindication.html'),('Specialized','Medication Definition','MedicinalProductIngredient','An ingredient of a manufactured item or pharmaceutical product.','https://www.hl7.org/fhir/medicinalproductingredient.html'),('Specialized','Medication Definition','MedicinalProductInteraction','The interactions of the medicinal product with other medicinal products, or other forms of interactions.','https://www.hl7.org/fhir/medicinalproductinteraction.html'),('Specialized','Medication Definition','MedicinalProductManufactured','The manufactured item as contained in the packaged medicinal product.','https://www.hl7.org/fhir/medicinalproductmanufactured.html'),('Specialized','Medication Definition','MedicinalProductPackaged','A medicinal product in a container or package.','https://www.hl7.org/fhir/medicinalproductpackaged.html'),('Specialized','Medication Definition','MedicinalProductPharmaceutical','A pharmaceutical product described in terms of its composition and dose form.','https://www.hl7.org/fhir/medicinalproductpharmaceutical.html'),('Specialized','Medication Definition','MedicinalProductUndesirableEffect','Describe the undesirable effects of the medicinal product.','https://www.hl7.org/fhir/medicinalproductundesirableeffect.html'),('Specialized','Medication Definition','SubstanceNucleicAcid','Nucleic acids are defined by three distinct elements: the base, sugar and linkage. Individual substance/moiety IDs will be created for each of these elements. The nucleotide sequence will be always entered in the 5-3 direction.','https://www.hl7.org/fhir/substancenucleicacid.html'),('Specialized','Medication Definition','SubstancePolymer','Todo.','https://www.hl7.org/fhir/substancepolymer.html'),('Specialized','Medication Definition','SubstanceProtein','A SubstanceProtein is defined as a single unit of a linear amino acid sequence, or a combination of subunits that are either covalently linked or have a defined invariant stoichiometric relationship. This includes all synthetic, recombinant and purified SubstanceProteins of defined sequence, whether the use is therapeutic or prophylactic. This set of elements will be used to describe albumins, coagulation factors, cytokines, growth factors, peptide/SubstanceProtein hormones, enzymes, toxins, toxoids, recombinant vaccines, and immunomodulators.','https://www.hl7.org/fhir/substanceprotein.html'),('Specialized','Medication Definition','SubstanceReferenceInformation','Todo.','https://www.hl7.org/fhir/substancereferenceinformation.html'),('Specialized','Medication Definition','SubstanceSpecification','The detailed description of a substance, typically at a level beyond what is used for prescribing.','https://www.hl7.org/fhir/substancespecification.html'),('Specialized','Medication Definition','SubstanceSourceMaterial','Source material shall capture information on the taxonomic and anatomical origins as well as the fraction of a material that can result in or can be modified to form a substance. This set of data elements shall be used to define polymer substances isolated from biological matrices. Taxonomic and anatomical origins shall be described using a controlled vocabulary as required. This information is captured for naturally derived polymers ( . starch) and structurally diverse substances. For Organisms belonging to the Kingdom Plantae the Substance level defines the fresh material of a single species or infraspecies, the Herbal Drug and the Herbal preparation. For Herbal preparations, the fraction information will be captured at the Substance information level and additional information for herbal extracts will be captured at the Specified Substance Group 1 information level. See for further explanation the Substance Class: Structurally Diverse and the herbal annex.','https://www.hl7.org/fhir/substancesourcematerial.html');
